import React from 'react';
import classes from './Inputs.module.css';
const Inputs = (props) => {
    const { name, placeholderString } = this.props.data;
    return (

       <input className={classes.myInput} {...props} type="text" name={name} placeholder={placeholderString}>

        {props.children}
       </input>

    );
};


export default Inputs;
